import React, { Component } from "react";
import NavBar from "./components/NavBar";
import LoginForm from "./components/LoginForm";

class Teste extends Component {
  render() {
    return (
      <React.Fragment>
        <NavBar />
        <LoginForm />
      </React.Fragment>
    );
  }
}

export default Teste;
